import React from 'react';
import face from './faces.png';
import styles from './About.css';

class About extends React.Component {
    render() {

        const image = {
            textAlign: "left",
            height: "200px"
        };

        const style1 = {
            color: "red",
        };

        return (
            <div>
                <p className='tc .bg-light-yellow'>About</p>
                <div>
                    <img src={face} style={image} alt='pic of faces' />
                    <p style={style1}>This is a sample paragraph to test the working of the program</p>
                </div>
            </div>
        );
    }
}

export default About;
